import { Link } from 'react-router-dom';


const CharactersList = ({ characters }) => {

    return (
        <ul>
            {characters.map(character => (
                <li key={character.id}>
                    <Link
                    to={`/character/${character.id}`}></Link>
                </li>
            ))}
        </ul>
    )

}

export default CharactersList;
